(2, 'Home2', 'Latest News', '', '<ul class=\"popular-posts\">\r\n						<li>\r\n							\r\n							<p>Give first 20% fly ash free: National Green Tribunal.</p>\r\n							<span>NASHIK: The National Green Tribunal (NGT) Pune has instructed the thermal power station here to give the first 20% of the fly ash for free to brick kiln manufacturers last week, while hearing the application filed by Nashik Fly Ash Bricks Association.</span>\r\n						</li>\r\n						<li>\r\n							\r\n							<p>Order of the National Green Tribunal regarding utilization of the fly ash in various industries, 28/04/2014.</p>\r\n							<span>Order of the National Green Tribunal (Central Zonal Bench, Bhopal) in the matter of Fly Ash Bricks Manufacturing Welfare Society v. State of M.P. & Ors. dated 28/04/2014 regarding utilization of the fly</span>\r\n						</li>\r\n						<li>\r\n							\r\n							<p>Judgement of the National Green Tribunal regarding fly ash utilization for brick manufacturing, 21/03/2014.</p>\r\n							<span>Judgement of the National Green Tribunal (Western Zone Bench, Pune) in the matter of Nasik Fly Bricks Association Vs MoEF & Ors dated 21/03/2014 regarding fly ash utilization for brick manufacturing.</span>\r\n						</li>\r\n					</ul>', '', '', 'Active');
INSERT INTO `page` (`id`, `mid`, `title`, `heading`, `keyword`, `description`, `image`, `text`) VALUES
(1, '1', 'About Us ', 'About Us ', '         \r\n', '', '', '<p>This group is created with a purpose to provide an easy access of education to all the section of students.This group is basically a group of expert faculties including Civil Servants, Senior Professors,Authors,Senior Professionals working together with a common objective of making e-education available to everyone and to guide aspirants in a smart way, so that they can achieve their goal and fulfill their dreams with quality preparation. &quot;<strong>The Catalyst</strong>&quot; will definitely work as an accelerator in their path of success.</p>\r\n');
