l; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">&bull;This course includes Video lectures which will be uploaded regularly at 8pm and will remain save in your profile till the date of exam.With daily video lectures you will be provided with pdf notes and practice questions also.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">With theory and conceptual lectures,lectures for question practice will also be uploaded.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">&bull;Online Test series and regular doubt sessions will be conducted in which you will be directly in touch of the concerned faculty to clear your doubts personally.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">&bull;All subjects will be covered in depth so that you can understand and retain it for a long time.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">&bull;Conventional question practice sessions will also be there in which you will be provided with questions which you have to solve and send the picture back to us so that our faculty can personally check them and let you know where you are lacking.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"