-size: 18px;\">General Introduction of Madhya Pradesh, area, topography and structure, physical and geographic areas and climate.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"border: 1px dashed rgb(115, 115, 115); padding: 12px; background-image: url(https://www.thecatalystgroup.info/public/ckeditor/plugins/showblocks/images/block_p.png?t=EAPE); margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; background-position: left top; background-repeat: no-repeat no-repeat;\"><span style=\"color: rgb(0, 0, 205);\"><span style=\"font-size: 18px;\">2. Natural Resources of Madhya Pradesh</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"border: 1px dashed rgb(115, 115, 115); padding: 12px; background-image: url(https://www.thecatalystgroup.info/public/ckeditor/plugins/showblocks/images/block_p.png?t=EAPE); margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; background-position: left top; background-repeat: no-repeat no-repeat;\"><span style=\"color: rgb(0, 0, 205);\"><span style=\"font-size: 18px;\">Mineral Wealth.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"border: 1px dashed rgb(115, 115, 115); padding: 12px; background-image: url(https://www.thecatalystgroup.info/public/ckeditor/plugins/showblocks/images/block_p.png?t=EAPE); margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; background-position: left top; background-repeat: no-repeat no-repeat;\"><span style=\"color: rgb(0, 0, 205);\"><span style=\"font-size: 18px;\">Forest Wealth and Wild Life.</span></span></p>\r\n	</div>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Agriculture and Live stock, Regional distribution of crops, planned development of Agriculture, Green Revolution, Development of Live stock.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Water Resources &ndash; Development of Irrigation and Irrigation projects.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">3. Human Resources</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Population, Population Density, Urban and Rural population, Literacy and Labours.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">4. Energy Resources</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Questions will attempt to assess the general awareness of candidates about the conventional and non-conventional sources of energy and their uses in human life.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">5. Industries</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Attempt will be made to assess the general awareness of candidates about the types and size of industries and their impact on state economy.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">6. Environment</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Questions will be related to environment and its protection, pollution, natural climates and their impact on quality of human life.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">7. Planning and Evaluation</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Attempt will be to assess the general awareness of candidates about different aspect of five year plans till date, various programmes of urban and rural development, economic planning and its evaluation and status of Madhya Pradesh in the context of Country.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">8. Administrative Structure of Madhya Pradesh</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Questions will be related to general knowledge of candidates about administrative units &ndash; Division, District, Tehsil and Development-Blocks; their relationship and administrative structure.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">9. Rural and Urban Administrative Structure</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Questions will be pertaining to the general knowledge of candidate about organization and administrative structure of Pachayati Raj, Municipality and Municipal corporation.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">10. Games and Sports</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Attempt will be made to assess the awareness of candidates related to organization, management and facilities for different games and sports. The questions will also be related to different State awards, and personalities and contribution of Government and non Government agencies.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">11. Culture, Literature, Music, Dance, Arts and History of Madhya Pradesh</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">1. Culture</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">The questions will be related to nature, types their salient features and impact on human life.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">2. Literature</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">(1) Ancient &ndash; Kalidas, Bharthari, Bhavbhuti, Vanabhatta.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">(2) Medieval &ndash; Keshav, Padmakar, Bhushan.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">(3) Modern &ndash; Pandit Makhanlal Chaturvedi, Subhadra Kumari Chauhan, Gajanan Madhav Muktibodh, Balkrishna Sharma &ldquo;Navin&rdquo;, Bhavani Prasad Mishra, Harishankar Parsai, Sharad Joshi, Mulla Ramoozi, Shiv-Mangal Singh, Suman</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">and Nanddulare Vajpai</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">(4) Folk Literature/Dialects of Madhya Pradesh. Isuri, Singaji.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">3. Music &amp; Dance Tradition</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">(1) Music Tradition &ndash; Tansen, Ustad Allauddin Khan, Ustad Hafiz Ali Khan, Pandit Krishna Rao, Shankar Pandit, Rajabhaiya Poonchwale, Ustad Amir Khan, Kumar Gandharva, Maharaj Chakradhar Singh Pandit Kartik Ram.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">(2) Dance tradition &ndash; Major styles of folk music, major folk dances.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">4. Arts</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Questions of general nature will be related to characteristics of Rock painting, folk painting, modern painting school and important painters. It will also have questions related to major folk and other theatres.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">5. Major Scheduled Tribes</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">It will assess the general awareness of candidates related to names, characteristics, habitats, major fairs and festivals and cultural structure of major scheduled tribes. It will also have questions related to different programmes of State Government for the upliftment of Scheduled Tribes.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">6. Programmes of State Government in the field of Culture</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">The questions will attempt to assess general knowledge of the candidate related to literasy academics and institutions. The questions will also be related to different Music and Fine Arts Schools and Cultural festivals. There will be questions awards given by the state for the significant contribution in the field of literature, music and fine arts.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">7. Archaeological Heritage</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">The questions of general knowledge will be related to significance and characteristics of major historical, archaeological and tourist places.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">8. Historical perspective of Madhya Pradesh</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">The questions will be related to creation of M.P. and important dynasties and rules of M.P., It will also have questions related to contribution of M.P. in freedom movement.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span style=\"text-decoration: underline\">Section (B) </span><span devanagari=\"\" kohinoor=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \">à¤¹à¤¿à¤‚à¤¦à¥€</span><span style=\"text-decoration: underline\"> </span><span devanagari=\"\" kohinoor=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \">à¤­à¤¾à¤·à¤¾</span></span></span></p>\r\n\r\n	<p devanagari=\"\" kohinoor=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \">&bull; </span>à¤µà¥à¤¯à¤¾à¤•à¤°à¤£<span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> </span>à¤¸à¤‚à¤¬à¤‚à¤§à¥€<span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> </span>à¤µà¤¸à¥à¤¤à¥à¤¨à¤¿à¤·à¥à¤ <span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> </span>à¤ªà¥à¤°à¤¶à¥à¤¨<span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> </span>à¤œà¤¿à¤¸à¤®à¥‡à¤‚<span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> </span>à¤¸à¤‚à¤œà¥à¤žà¤¾<span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \">, </span>à¤¸à¤°à¥à¤µà¤¨à¤¾à¤®<span helvetica=\"\" neue=\"\" sty