l; font-family: \"> </span>à¤ªà¥à¤°à¤¶à¥à¤¨<span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> </span>à¤¹à¥‹à¤‚à¤—à¥‡<span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> </span><span bangla=\"\" kohinoor=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \">à¥¤</span></span></span></p>\r\n\r\n	<p devanagari=\"\" kohinoor=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \">&bull; </span>à¤…à¤ªà¤ à¤¿à¤¤<span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> </span>à¤—à¤¦à¥à¤¯à¤¾à¤‚à¤¶<span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> </span>à¤¸à¥‡<span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> </span>à¤¸à¤®à¥à¤¬à¤‚à¤§à¤¿à¤¤<span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> 5 </span>à¤µà¤¸à¥à¤¤à¥à¤¨à¤¿à¤·à¥à¤ <span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> </span>à¤ªà¥à¤°à¤¶à¥à¤¨<span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> </span>à¤ªà¥‚à¤›à¥‡<span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> </span>à¤œà¤¾à¤à¤‚à¤—à¥‡<span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> </span><span bangla=\"\" kohinoor=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \">à¥¤</span><span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> </span>à¤ªà¥à¤°à¤¤à¥à¤¯à¥‡à¤•<span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> </span>à¤ªà¥à¤°à¤¶à¥à¤¨<span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> 2 </span>à¤…à¤‚à¤•<span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> </span>à¤•à¤¾<span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> </span>à¤¹à¥‹à¤—à¤¾<span helvetica=\"\" neue=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \"> </span><span bangla=\"\" kohinoor=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \">à¥¤</span></span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span style=\"text-decoration: underline\">Section (C) English Language</span></span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">The syllabus for the examination General English will be as follows-</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">The objective type question paper will carry maximum 25 marks each question of one mark.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">&bull; Applied grammar containing topics like parts of speech vocabulary, Active Passive, Direct and indirect speech, Transformation of sentence.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">&bull; Sentence completion questions (fill in the blanks). These will be of the nature of multiple choice questions.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">&bull; Questions on reading comprehension (Based on an unseen passage each).</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span style=\"text-decoration: underline\">Paper II</span></span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Syllabus of this paper will be the same as prescribed for the Pre written examination.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span style=\"text-decoration: underline\">Pre Written Examination</span></span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span style=\"text-decoration: underline\">Exam Pattern</span> : Exam Pattern for the MPPSC Assistant Engineer Pre Written Exam is as Follows :-</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span grande=\"\" lucida=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \">â–º</span> The written test will be descriptive type.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span grande=\"\" lucida=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \">â–º</span> There will be two papers for each subject.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span grande=\"\" lucida=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \">â–º</span> Each paper will carry 50 questions and 300 marks.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span grande=\"\" lucida=\"\" style=\"font-stretch: normal; line-height: normal; font-family: \">â–º</span> Minimum Qualifying marks will be 40% marks (for SC/ST/OBC 30% marks).</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span style=\"text-decoration: underline\">Exam Syllabus</span> : Exam Syllabus for Assistant Engineer Main written Exam is given below:-</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span style=\"text-decoration: underline\">C I V I L</span>&nbsp; <span style=\"text-decoration: underline\">E N G I N E E R I N G</span>&nbsp; ( <span style=\"text-decoration: underline\">C O D E</span>&nbsp; <span style=\"text-decoration: underline\">N O .</span>&nbsp; <span style=\"text-decoration: underline\">0 1</span> )</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span style=\"text-decoration: underline\">PAPER &ndash; I</span></span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">1. Structural Analysis</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Determinate and Indeterminate Structures, Degrees of Freedom. Static and Kinematic indeterminacy, Principle of Superposition, Virtual Work, Energy theorem, Deflection of Trusses, Redundant Frames. Analysis of Determinate and Indeterminate Arches, their influence lines. Rolling loads, influence lines for Determinate Beams and Pin-jointed Frames. Mullar Breslau&rsquo;s Principle and influence lines for Indeterminate Beams and Frames. Slope Deflection, Moment Distribution and Kani&rsquo;s methods. Column Analogy, Energy Methods for analysis of indeterminate beams and frames. approximate methods for analysis of Rigid Frames. Matrix Methods of analysis, Stiffness and Flexibility Matrices of Beams. Frames &amp; Trusses, Elements of Plastic analysis.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">2. Structural Design</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">(1) Steel Design</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Factors of Safety and Load Factors. Rivetted and Welded connections of Members, Design of Tension, Compression and Flexural members, built-up beams and Plate Girder Slab and Gusseted Bases for Columns, Design of Roof Trusses. Purling and Coverings, Structural Steel tubes and their connections Industrial and Multi-Storyed Buildings Water tank and supporting tower&rsquo;s design. Plastic Design of Continuous Beams &amp; Frames.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">(2) R.C. Design</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Working Stress and Limit State methods for design of Rectangular, T and L Beams, Slabs and Columns. Isolated and Combined footings, Raft Foundations. Overhead, Resting on ground and Underground Water Tanks. Design of Bunkers and Silos. Methods and Systems of Prestressing, Anchorages. Losses in Prestress, Design of Prestressed Concrete Beams.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">3. Construction Planning and Management</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Detailed estimates, specifications, analysis and rates of various works in civil engineering. Construction activity, work break down structures, scheduling through CPM and PERT analysis, cost optimization through network construction, Float times, Bar charts, Project control and super-vision, cost reduction measures, Cost analysis and resource allocation, Fundamentals of engineering economics, methods of appraisal, present work, annual costs, benefit cost analysis, Types of tenders and contract conditions.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">4. Environmental Engineering</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Water Demand &ndash; Per capita Demand, Population Estimation methods Water Quality Criteria for various uses viz. Domestic &amp; Non-Domestic, Irrigation effects &amp; significance of important parameters and permissible concentration as per relevant standards. Transmission of Water- relative merits &amp; demerits of various pipes viz C.I. G.I. Mild Steel. A.C. Pressure Pipes. Corrosion of Pipes-types &amp; Methods of control System of distribution &amp; layouts of distribution. Unit Processes &amp; Operations for Water Treatment viz, Objectives and Design criteria of Sedimentation, Coagulation, Flocculation, Chemical Sedimentation. Filtration (slow sand &amp; rapid sand), Disinfection, Softening. Quantity &amp; Characterization of Domestic Sewage-significance of B.O.D., C.O.D., D.O., Solids. T.O.C., N.O.D. Effluent Standards, River Standards. Sewage System-Design of Sewer &amp; Storm Sewer, Sewage Pumps. Design of Screens, Grit Chamber. Design of Primary Sedimentation tank. Design of Biological Treatment Units viz. Trickling filters, Activated Sludge Treatment and Secondary Sedimentation tank. Waste Stabilization Ponds- Aerobic, Anaerobic &amp; Facultative Ponds, design criteria and principles. Sludge Treatment- Digestion &amp; Sludge Disposal. Septic Tanks-design criteria &amp; working Self Purification of Streams- oxygen sag curve. Types of Pollution-Sources &amp; effects of various pollution viz., Water, Air, Land &amp; Noise, Relevant standards. Rural Sanitation, Solid Waste- collection &amp; disposal.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span style=\"text-decoration: underline\">PAPER &ndash; II</span></span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">1. Water Resources Engineering</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Water Resources in the Globe, Available Fresh Water. Need for Optimum use of Available water, Schemes for Drinking, Irrigation, Hydro Power, Multipurpose Schemes. Irrigation &ndash; Necessity, Scope, Benefits &amp; Effects. Methods &amp; Systems of Irrigation, their efficiencies. Water Distribuion &amp; Scheduling techniques. Crop Water Requirements, Evapotranspiration, Consumptive Use, Duty, Delta, Base Period their relation, Crop Rotation, Quality of Irrigation Water. Hydrology &ndash; Hydrological Cycle, Precipitation &ndash; Types, Measurement, Raingauge Network, Analysis of Precipitation Data, Dependability Analysis, Unit Hydrograph, Summation &amp; Synthetic Hydrographs, Design Flood by UH &amp; Frequency Studies. Ground Water &ndash; Class &amp; Availability of Soil Moisture. Aquifers- Confined &amp; Unconfined. Open &amp; Tube Wells, Radial Flow in Wells, Depuit&rsquo;s Theory. Darey&rsquo;s Law, Seepage Analysis using Flow Nets. Yield of Wells, determination. Storage Scheme &ndash; Reservoir Planning, Capacity, Yield, Life. Gravity &amp; Earthen Dams. Forces Acing, Modes of Failure, Stability Criteria, Design. Galleries. Shafts. Joints in Gravity Dams. Foundation Treatment. Spillways, Types, Design of Ogee &amp; Syphon Spillways. Energy Dissipating Devices, Design of Stilling Basins. Diversion Schemes &ndash; Structures on Pervious Formations, Bligh&rsquo;s &amp; Khosla&rsquo;s Theory, Hydraulic Jump, Design of Vertical Drop Weir &amp; Barrage. Distribution System &ndash; Canals &ndash; Classification, Layout, Alignment, Capacity, Design of Canals. Silt Theories, Canal Regulation Structures. Design of Head &amp; Cross Regulators, Canal Falls, Cross Drainage Works, and Outlets, Escapes. Water Logging &ndash; Causes, Effects, Remedial Measures, Losses in Canals, Canal Lining, Types. Advantages, Conjunctive use of Surface &amp; Ground Water. River Training &ndash; Objective &amp; Methods, Concepts of Hydro Power Projects.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">2. Transportation Engineering</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Railways &ndash; Permanent Way, Sleepers, Rail Fastenings, Ballast, Points and Crossings, different types of Turn Outs. Stations and Yards, Turn Tables, Signals and Interlocking, Level Crossing. Maintenance of Track, Super-elevation, Creep of Rails, Ruling Gradients, Track Resistance. Tractive Efforts, Curve Resistance. Highways &amp; Airports &ndash; Principles of Highway Planning, Highway Alignments. Geometrical design, Cross-section. Camber, Super-elevation. Horizontal and Vertical curves. Classification of Roads. Design and Construction of Flexible and Rigid pavements for Highway and Airfields. Evaluation of Pavement Failure and Strengthening, Drainage of Roads. Traffic Engineering : Traffic Surveys, Highway Capacity, Intersections, Rotary Design Elements, Signs, Signals and Markings. Selection of Airport Sites, Windrose Diagram &amp; Runway Orientation. Runway and Taxiway Geometric and Lighting. Bridge Engineering &ndash; Selection of Site, Design Data collection, Hydraulic Design, Scour Depth for Bridge Foundation, Economic Span. Type of Road and Railway Bridges, Design Loads and Forces, Impact Factor, Indian Loading Standards. Super Structure &amp; Sub Structure, Abutments, Piers, Wing Walls, Return Approaches.</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">3. Geotechnical Engineering</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Index Properties of Soil, Classification of Soils. Clay Minerals. Capillary Water, Permeability, Factors Affecting Permeability, Lab and field methods. Permeability of stratified soil deposits. Seepage Pressure, Quick Sand Condition, Flow Net, its properties &amp; uses. Stess distributioin in soils, Boussinesq&rsquo;s theory. Newmark&rsquo;s Chart. Consolidation and Settlement : Terzaghi&rsquo;s theory, Consolidation test. Settlement computiation. Time Settlement cureve. Compaction tests &amp; their significance, factors affecting compaction. Shear Strength Parameters, Shear Tests, Mohr Coulomb&rsquo;s failure theory, Skempton&rsquo;s Pore Pressure coefficients. Earth Pressure at rest, Active and Passive Pressures, Rankine&rsquo;s and Coulomb&rsquo;s theory. Bearing capacity, Terzaghi&rsquo;s analysis, factors affecting Bearing Capacity, Plate Load Test. Stability of Slopes, Sweedish Slip Circle method and Bishop&rsquo;s simplified method. Stability Number. Sub-surface exploration. Methods, sampling, SPT, DCPT and Static Cone Penetration Test, Electrical Resistivity and Seismic method. Essential features of Foundation, types, design criteria, Rafts. Pile Foundation, Types of Piles, Pile Capacity, Pile Load Test. Group Action. Static/</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\">Dynamic formulae. Elements of Machine Foundation, Natural frequency, Amplification and Resonance. Ground Improvement Techniques, Sand Drains, Soil Stabilization, Geotextiles</span></span></p>\r\n\r\n	<p helvetica=\"\" neue=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \">&nbsp;</p>\r\n\r\n	<p><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">&quot;We are here to accelerate your career smartly&quot;</span></span></span></p>\r\n	</li>\r\n</ul>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<h2 style=\"text-align: center;\"><span style=\"font-size:22px;\"><u><em><span style=\"color:#0000CD;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><span style=\"background-color:#FFFF00;\">For Eligible candidates only</span></span></span></em></u></span></h2>\r\n\r\n<div class=\"row justify-content-md-center\">\r\n<div class=\"col col-lg-4\"><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><img alt=\"\" src=\"/public/ckeditor/files/Uploads/module/ads.jpg\" /></span></span></span></div>\r\n\r\n<div class=\"col col-lg-8\">\r\n<p><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">DISCOUNTS/-</span></span></span></p>\r\n\r\n<p><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">#You have to first mail the documents,then after confirmation by our admission cell that you are considered under EWS,waiver will be given.<br />\r\n**Mail the documents on thecatalystgroup.official@gmail.com ***</span></span></span></p>\r\n\r\n<p><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">*For Economically Weaker Section students-<br />\r\n50% fee waiver<br />\r\n#EWS here means(&bull;family income &lt; 2 lakh&bull;Should have studied with education loan&bull;)<br />\r\n*In this decision of managment team will be final*</span></span></span></p>\r\n\r\n<p><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">&quot;STUDENT ELIGIBLE FOR DISCOUNT HAVE TO PAY REMAINING FULL FEE AT THE TIME OF ADMISSION&quot;</span></span></span></p>\r\n\r\n<p><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">#Students taking discount have to deposit the fee offline directly into the catalyst bank account</span></span></span></p>\r\n\r\n<p><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">*FEE INSTALMENTS FOR FULL COURSES*</span></span></span></p>\r\n\r\n<p><span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Students who are joining full courses can pay fee in instalments of two,50% at the admission tym and remaining 50% in 30 days of admission But in this case no discount and fee waiver will be given.<br />\r\nThis clause is not valid for individual courses.</span></span></span></p>\r\n\r\n<p><br />\r\n<span style=\"color:#0000CD;\"><span style=\"font-size:18px;\"><strong><span style=\"background-color:#FFFF00;\">&quot;STUDENTS PAYING FEE IN INSTALMENTS ARE NOT ELIGIBLE FOR DISCOUNTS&quot;</span></strong></span></span></p>\r\n</div>\r\n</div>\r\n');
