(5, '7', 'Online Lectures Schedule', 'Online Lectures Schedule', '   ', '', '', '<h3 style=\"text-align: center;\" text-center=\"\">Class timetable will be updated on weekly basis</h3>\r\n\r\n<div class=\"pricing-wrapper clearfix\">\r\n<div class=\"GridLex-gap-0\">\r\n<div class=\"GridLex-grid-noGutter-equalHeight\">\r\n<div class=\"GridLex-col-6_sm-6_xs-12_xss-12\">\r\n<div class=\"pricing-item\">\r\n<div class=\"pricing-heading\">\r\n<h4 class=\"pricing-title  text-center\">Class schedule(16-21October)-GATE and IES (jpeg)</h4>\r\n</div>\r\n\r\n<div class=\"mt-20 text-center\"><a class=\"btn btn-primary\" href=\"#\">Download</a></div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"GridLex-col-6_sm-6_xs-12_xss-12\">\r\n<div class=\"pricing-item\">\r\n<div class=\"pricing-heading\">\r\n<h4 class=\"pricing-title text-center\">Class Schedule(16-21Oct)-SSC JE (jpeg)</h4>\r\n</div>\r\n\r\n<div class=\"mt-20 text-center\"><a class=\"btn btn-primary\" href=\"#\">Download</a></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n'),
(7, '3', 'Admission', 'Admission and Fees', '   \r\n \r\n', '', '', '<div class=\"pricing-wrapper clearfix\">\r\n<div class=\"GridLex-gap-0\">\r\n<div class=\"GridLex-grid-noGutter-equalHeight\">\r\n<div class=\"GridLex-col-6_sm-6_xs-12_xss-12\">\r\n<div class=\"pricing-item\">\r\n<div class=\"pricing-heading\">\r\n<h4 class=\"pricing-title  text-center\">Admission by fee deposition in Bank</h4>\r\n</div>\r\n\r\n<div class=\"pricing-content text-center\">\r\n<p>You can take the admission in specific program by depositing the fees directly to the bank account by netbanking or any other way.</p>\r\n\r\n<p>Account name:The Catalyst<br />\r\nBank Name:Axis Bank<br />\r\nAccount Number: 917020051859780<br />\r\nIFSC: UTIB0001084</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"GridLex-col-6_sm-6_xs-12_xss-12\">\r\n<div class=\"pricing-item\">\r\n<div class=\"pricing-heading\">\r\n<h4 class=\"pricing-title text-center\">Online Payment</h4>\r\n</div>\r\n\r\n<div class=\"pricing-content text-center\">\r\n<p>You can take admission by paying online through secure RAZORPAY&nbsp;gateway also by using credit/debit card/netbanking from our website</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You can scan the code and pay fees directly also,after payment please mail us the receipts on thecatalystgroup.edu@gmail.com</p>\r\n\r\n<p><img alt=\"\" src=\"https://www.thecatalystgroup.info/public/ckeditor/files/Uploads/sliderimage/IMG_6846.jpg\" style=\"width: 200px; height: 174px;\" /></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n'),
(9, '13', 'Careers', 'Careers', ' Manager', 'Apply for the post of manager', '', ''),
(10, '12', 'Our Privacy Policy', 'PRIVACY POLICY', '            ', '', '', '<p>1.THE CATALYST GROUP is committed to the ethical collection, retention and use of information that you provide to us about yourself (&ldquo;Personal Information&rdquo;) on this site&nbsp;<a data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.thecatalystgroup.info&amp;source=gmail&amp;ust=1513083480352000&amp;usg=AFQjCNE75_ufWRvqQp9kAIgnAdxdZWKxeQ\" href=\"http://www.thecatalystgroup.info/\" target=\"_blank\">www.thecatalystgroup.info</a></p>\r\n\r\n<p>2.Your Personal Information may comprise the following:</p>\r\n\r\n<ul>\r\n	<li>Your name</li>\r\n	<li>A user ID and password of your choice</li>\r\n	<li>Your email ID and mailing address</li>\r\n	<li>Your telephone number</li>\r\n	<li>Your payment processing details</li>\r\n	<li>Details of your payment process</li>\r\n	<li>Limited personal details</li>\r\n	<li>Any other data as may be required.</li>\r\n</ul>\r\n\r\n<p>3. The following Privacy Policy sets forth our understanding with you on the collection, use and protection of your Personal Information. Please read the entire Privacy Policy.</p>\r\n\r\n<p>4. Your use of the website constitutes your consent to all the terms and conditions contained in this privacy policy (as amended from time to time) and you shall be obligated by the same.</p>\r\n\r\n<p>5. Collection of Information</p>\r\n\r\n<ul>\r\n	<li><strong>Website Browsing</strong> : You can browse the Website anonymously. We do not ask to identify yourself or reveal any Personal Information while browsing through the Website. However, you may not be able to access certain sections of the Website or interact with us without supplying us with Personal Information. By filling up the online admission form you will be supplying us with the required Personal Information.</li>\r\n	<li>While you are browsing through the Website, the Website&rsquo;s operating system may automatically record some &ldquo;General Information&rdquo; about your visit such as :</li>\r\n	<li>The date and time you visited the website, along with the address of the previous website you were visiting, if you are linking to us from another website.</li>\r\n	<li>The type of browser you are using (such as Internet Explorer version &lsquo;X&rsquo;)</li>\r\n	<li>The General Information is not Personal Information. The Catalyst group tracking system does not record personal information about individuals or link this information to any Personal Information collected from you.</li>\r\n	<li>The General Information is used by The Catalyst Group for statistical analysis, for tracking overall traffic patterns on the website and to gauge the public interest in The Catalyst Group and the website. Such General Information may be shared by The Catalyst Group with any person, at The Catalyst Group&rsquo;s sole discretion.</li>\r\n	<li>Any communication or material that you transmit to, or post on, any public area of the website, including any data, questions, comments, suggestions, or the like, is and will be treated as, non-confidential and non-proprietary information.</li>\r\n</ul>\r\n\r\n<p>6. Within&nbsp; The Catalyst Group access to Personal Information collected by The Catalyst Group will be given only to those persons who are authorized The Catalyst Group and third parties hired by The Catalyst Group&nbsp; to perform administrative services. The Catalyst Group&nbsp; will provide access to third parties for internal entry and management of Personal Information in The Catalyst Group Database, processing your admissions or fee preparing address labels, sending Emails, which require such third parties to have access to your Personal Information.The Catalyst Group cannot guarantee that such parties will keep The Catalyst Group your Personal Information confidential and&nbsp;will not be liable in any manner for any loss of confidentiality attributable to such third parties.</p>\r\n\r\n<p>7. We respect student&rsquo;s privacy and the privacy of those accessing our website. We undertake to protect the confidentiality of our students and users including all personal information supplied in the course of taking admission. We undertake not to offer your personal information to third parties for commercial or marketing purposes.&nbsp;</p>\r\n\r\n<p><strong>PAYMENT FAILURES</strong></p>\r\n\r\n<p>For any failures in online payment and in case the amount gets deducted from your saving/current account and not credited in&nbsp;</p>\r\n\r\n<p>The Catalyst Group account, before the transaction is complete;The Catalyst Group is not responsible for any refunds. In this case, students should first contact the Bank and then to The Catalyst Group to clarify the same.&nbsp;</p>\r\n\r\n<p><strong>FEES AND PAYMENT</strong></p>\r\n\r\n<p>It is the enrollee&rsquo;s sole responsibility to ensure that he/she pays the enrollment fees. The payment of any amounts intended to be made in respect of Fees by or on behalf of the enrollee does not indicate the acceptance of enrollee&rsquo;s candidature for appearing in the examination. When the enrollee successfully completes the online payment transaction using credit/debit card option, funds will be deducted from the credit/debit card as per submitted by him/her and the payment will be credited to The Catalyst Group.This payment is towards enrollment for The Catalyst Group&nbsp; various courses. Any payment received through this website will be treated as having been made by the enrollee even though the same may have been made by some other person/ party and hence The Catalyst Group shall not entertain any correspondence from any person other than the enrollee or his/her parent/guardian.</p>\r\n\r\n<p>&nbsp;THE CATALYST GROUP will&nbsp;not tolerate any misbehaviour from the side of students and the management can cancel admission if any such behaviour exists.Management decision will be final in this regard.</p>\r\n\r\n<p><strong>CONFIRMATION</strong></p>\r\n\r\n<p>If the enrollee&rsquo;s online payment is successful, The Catalyst Group will confirm the same by giving a valid transaction ID. In case of unsuccessful online payment, The Catalyst Group will advise the enrollee accordingly. The enrollee should then contact the credit/debit card provider for details.</p>\r\n\r\n<p>&nbsp;<strong>FAILURE TO PAY THE FEES</strong></p>\r\n\r\n<p>In case the enrollee registers successfully, but the online payment is not successful, his/her enrollment will stand cancelled without any further notification.</p>\r\n\r\n<p>&nbsp;<strong>REFUND &amp; CANCELLATION</strong></p>\r\n\r\n<p>The fee for various courses is non-refundable&amp; admission will not be cancelled,also books once shipped will not be returned and if returned by customer then refund will not be provided.As we have no return and refund &nbsp;policy .For wrong and incompleted address ,if book is returned then extra shipping charges will be applicable on customer.&nbsp;</p>\r\n\r\n<p><strong>DATA PROTECTION</strong></p>\r\n\r\n<p>The Catalyst Group will be entitled to use the information given during the Online Payment process for the purpose of registration of the enrollee as also as for statistical purposes.</p>\r\n\r\n<p>Note: Terms and Conditions for online credit card/debit card payments are subject to change at any time. Each transaction shall be subjected to the specific Terms and Conditions that were in force at the time of the transaction.</p>\r\n\r\n<p><b><span style=\"background-color:#FFFF00;\">Notice: In case of any misbehaviour by any student with the staff and other members or students.Catalyst is authorised to take action depending upon the severity of the issue.</span></b></p>\r\n'),
(11, '10', 'STUDENT REVIEWS', 'STUDENT REVIEWS', 'CATALYST GROUP REVIEWS                                           ', 'REVIEWS', '', '<div class=\"row\">\r\n<div class=\"col-md-6 col-md-12\"><img alt=\"\" class=\"img-responsive\" src=\"https://www.thecatalystgroup.info/public/ckeditor/files/Uploads/courseimg/b1.jpeg\" /></div>\r\n\r\n<div class=\"col-md-6 col-md-12\"><img alt=\"\" class=\"imp-responsive\" src=\"https://www.thecatalystgroup.info/public/ckeditor/files/Uploads/courseimg/b2.jpeg\" /></div>\r\n\r\n<div class=\"col-md-6 col-md-12\"><img alt=\"\" class=\"imp-responsive\" src=\"https://www.thecatalystgroup.info/public/ckeditor/files/Uploads/courseimg/b3.jpeg\" /></div>\r\n\r\n<div class=\"col-md-6 col-md-12\"><img alt=\"\" class=\"imp-responsive\" src=\"https://www.thecatalystgroup.info/public/ckeditor/files/Uploads/courseimg/b4.jpeg\" /></div>\r\n\r\n<div class=\"col-md-6 col-md-12\"><img alt=\"\" class=\"imp-responsive\" src=\"https://www.thecatalystgroup.info/public/ckeditor/files/Uploads/courseimg/b5.jpeg\" /></div>\r\n\r\n<div class=\"col-md-6 col-md-12\"><img alt=\"\" class=\"imp-responsive\" src=\"https://www.thecatalystgroup.info/public/ckeditor/files/Uploads/courseimg/DD65D258-7FB8-466A-B878-ADD5FD8B3D40.JPG\" /></div>\r\n</div>\r\n'),
